import "./Footer.scss";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className=" info"></div>
        <div className=" my-page"></div>
        <div className=" product-tags"></div>
        <div className=" follow-us"></div>
      </div>
    </footer>
  );
};

export default Footer;
